import React from 'react';
import './App.css';
function ContactCard(props){
    return(
        <div>
           <img src={props.imgurl} className="image"/> 
            <h3>Mr.{props.name}</h3>
            <p>Phone:{props.phone}</p>
            <p>Email:{props.email}</p>
        </div>
    );
}

export default ContactCard;
